import Category from "../componets/Category";

function CategoryList(props){
    return(
        <div>
            {props.items.map(category=>(
                <Category 
                key={category.key} 
                name={Category.name} 
                description={Category.category}></Category>
    ))}

        </div>
    )
}

export default CategoryList
